import React, { useState } from "react";
import {
    Table,
    TableHead,
    Avatar,
    TableRow,
    TableBody,
    TableCell,
    TableContainer,
    Box,
    IconButton,
} from "@mui/material";
//import { Link as RouterLink } from "react-router-dom";
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';
import BorderColorIcon from '@mui/icons-material/BorderColor';

import { useDispatch } from "react-redux";
import useAuth from "../../../hooks/useAuth";
import { deleteProduct } from "../../product/productSlice";
import { fCurrency, fNumber } from "../../../utils/numberFormat";
import ProductEdit from "./ProductEdit";



function ProductTable({ products }) {
    const [open, setOpen] = useState(false);
    const [productCurrent, setProductCurrent] = useState([]);
    const { user } = useAuth();
    const dispatch = useDispatch();


    const handleDeleteProduct = (id) => {
        if (user._id)
            dispatch(deleteProduct(id))
    }

    const handleClickOpen = (product) => {
        setProductCurrent(product);
        setOpen(true)

    };

    return (

        <Box sx={{ mt: 5 }}>
            <ProductEdit productCurrent={productCurrent} setOpen={setOpen} open={open} />
            <TableContainer sx={{ minWidth: { sx: 320, md: 650 }, overflowX: "auto" }}>
                <Table>
                    <TableHead >
                        <TableRow >
                            <TableCell sx={{ width: { xs: -5, md: -2 }, fontWeight: 600 }}>
                            </TableCell>
                            <TableCell sx={{ width: { xs: "10%", md: "25%" }, fontWeight: 600 }}>
                                Product
                            </TableCell>
                            <TableCell sx={{ width: { xs: "10%", md: "25%" }, fontWeight: 600 }}>
                                Types
                            </TableCell>
                            <TableCell sx={{ width: { xs: "10%", md: "25%" }, fontWeight: 600 }}>
                                Status
                            </TableCell>
                            <TableCell sx={{ width: { xs: "10%", md: "25%" }, fontWeight: 600 }}>
                                Price
                            </TableCell>
                            <TableCell sx={{ width: { xs: "10%", md: "25%" }, fontWeight: 600 }}>
                                PriceSale
                            </TableCell>
                            <TableCell sx={{ width: { xs: "10%", md: "25%" }, fontWeight: 600 }}>
                                Unit
                            </TableCell>
                            <TableCell sx={{ width: { xs: "10%", md: "25%" }, fontWeight: 600 }}>
                                Edit
                            </TableCell>
                            <TableCell sx={{ width: { xs: "10%", md: "25%" }, fontWeight: 600 }} >
                                Delete
                            </TableCell>
                        </TableRow>
                    </TableHead>

                    <TableBody>

                        {products.map((product) => {
                            const { productName, types, status, price, priceSale, unit, _id } = product
                            const image = product.image[0]
                            return (

                                <TableRow key={product._id}  >

                                    <TableCell sx={{ alignItems: "center" }}>
                                        <Avatar
                                            alt={productName}
                                            src={image}
                                            sx={{ mr: -3, mb: 1 }}
                                        />
                                    </TableCell>
                                    <TableCell
                                        sx={{
                                            display: { xs: "10%", md: "20%" },
                                            alignItems: "center",
                                            cursor: "pointer",
                                        }}
                                    > {productName}
                                    </TableCell>

                                    <TableCell
                                        align="left"
                                        sx={{ display: { xs: "10%", md: "20%" } }}
                                    >
                                        {types}
                                    </TableCell>
                                     <TableCell
                                        align="left"
                                        sx={{ display: { xs: "10%", md: "20%" } }}
                                    >
                                        {status}
                                    </TableCell>

                                    <TableCell
                                        align="left"
                                        sx={{ display: { xs: "10%", md: "20%", color: "red" } }}
                                    >
                                        {fCurrency(price)}
                                    </TableCell>

                                    <TableCell
                                        align="left"
                                        sx={{ display: { xs: "10%", md: "20%", color: "red" } }}
                                    >
                                        {fCurrency(priceSale)}
                                    </TableCell>

                                    <TableCell
                                        align="left"
                                        sx={{ display: { xs: "15%", md: "20%" } }}
                                    >
                                        {unit}
                                    </TableCell>


                                    <TableCell
                                        align="left"
                                        sx={{ display: { xs: "15", md: "20%" } }}
                                    >

                                        <IconButton onClick={() => { handleClickOpen(product) }}
                                            aria-label="edit" size="small">
                                            <BorderColorIcon fontSize="small" />

                                        </IconButton>

                                    </TableCell>

                                    <TableCell
                                        align="left"
                                        sx={{ display: { xs: "15", md: "20%" } }}
                                    >
                                        <IconButton onClick={() => {
                                            handleDeleteProduct(_id)
                                        }}
                                            aria-label="delete" size="small">
                                            <DeleteOutlineIcon fontSize="small" />
                                        </IconButton>
                                    </TableCell>


                                </TableRow>



                            );
                        })}

                    </TableBody>

                </Table>
            </TableContainer>
        </Box>
    );
}

export default ProductTable;
